window.bookSummaryJSON = "<p>A psychic assassin. A demonic presence. Survival has deadly consequences....</p> <p>After escaping an asylum, Felix drives across three states in search of bloody vengeance. When he arrives, however, he is instead roped into a plot to apprehend a psychic assassin murdering clergy. If he succeeds, Bishop X has promised to write him a blank check. If he fails, death will be the least of his worries.</p> <p>The assassin, however, is more cunning and deadly than even Felix Cross could have imagined.</p> <p>Trapped in the assassin's deadly grip, Felix must win this merciless killer's trust in order to secure his escape. With each passing day, the body count rises, and Felix's sanity inches closer to breaking down.</p> <p>Can Felix escape the assassin's terrifying trap before it's too late? Or will he become the latest victim?</p>"; 
